const MultiForm = () => {

    const [firstName, setFirstName] = useState("")
    const [lastName, setLastName] = useState("")
    const [email, setEmail] = useState("")
    const [mobile, setMobile] = useState("")


    return (
        <div className="mt-5 text-center">
        <h1 className="ProColor"> Multiple From এর কাজ </h1>
            <form>
                <input name="firstName" type="text" placeholder="First Name"></input><br></br>
                <input name="lastName" type="text" placeholder="Last Name"></input><br></br>
                <input name="email" type="text" placeholder="Email"></input><br></br>
                <input name="mobile" type="text" placeholder="Mobile"></input><br></br>
                <input type="submit" value="Submit"></input> 
            </form>
        </div>
    );
};

export default MultiForm;
